import Month from './Month';

let year;
let months = [];
export default class Year{
    newYear = (yearIn)=>{
        this.year = yearIn;
        console.log("new year ="+year);
    }
    getYear(){
        return this.year;
    }
    addMonth(monthIn){
        months.push(monthIn);
    }
}
